css:
@-moz-document domain("sendfox.org") {
Body {
	color: #fff;
	background-color: #292929;
}
.card{
    background-color: #171717;
    border: 1px solid #171717;
    box-shadow: 0px 0px 50px 1px rgb(253, 140, 2, 0.42);
}
#menu {
    background-color: #292929;
}
.navbar-top {
    border-bottom: 1px solid #171717;
}
#menu.fixed-on-scroll .navbar-bottom {
    background-color: #292929; 
}
footer {
    background-color: #292929;
}
.tabbernav .tabberactive {
    background-color: #292929;
    border-color: #000 #000 #000;
}
.tabbernav li {
    background: #292929;
    border: 1px solid #000;
}
.tabbernav {
    border-bottom: 1px solid #000000;
}
.tabbertab {
    border: 1px solid #000000;
}
a {
color: white !important;
}
.tabbertab textarea {
    color: white;
    background: #292929;
}
.form-control {
border: none;
}
}
